import React, { useState } from 'react';
import PopupWithForm from './PopupWithForm';

function InfoTooltip({name, isOpen,isActiveButtonSubmit, buttonVisibleControl, isClose, buttonCloseDisable}) {
    return (
        <PopupWithForm
        name = {name}
        isOpen = {isOpen}
        isClose = {isClose}
        validationOptions = {isActiveButtonSubmit}
        />
    )
}

export default InfoTooltip;
